import axios from "axios";

const actions = {
    // getBoard({ commit }) {
    //     fetch(this.state.apiURL + "board")
    //         .then(response => response.json())
    //         .then(dados => {
    //             commit("setBoard", dados.data)
    //         })
    // },

    getBoard({ commit }) {
        return axios.get("board")
            .then(res => {
                commit("setBoard", res.data)
            })
    },
}

export default actions;
